<script>
const qs = require('qs');
export default {
  layout: "gobelin",
  data() {
    return {
      map: null,
    };
  },
  methods: {
    getInfo(map) {
      this.map = map;
    },
    reset(){
      this.map = null;
    },
  },
  async asyncData({ $axios }) {
        const query = qs.stringify({
            fields: '*',
            populate: "*",
            pagination: {
                page: 1,
                pageSize: 24,
            },
        }, {
        encodeValuesOnly: true,
        });

        const { data } = await $axios.$get(`https://api.laterredumilieu.fr/api/mapgobelins?${query}`); 
        let maps = data
        return { maps }
    },
};
</script>
